import React, { useState, createContext } from "react";


export const GrobalContex = createContext();

export const GlobalContexProvider = props => {
  const [GlobalContex, setGlobalContex] = useState({ url: "http://localhost:5000" })
  return (
    <GrobalContex.Provider value={[GlobalContex, setGlobalContex]}>
      {props.children}
    </GrobalContex.Provider>
  );
};
